import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Importar Routes em vez de Switch
import Login from './components/Login';

function App() {
  return (
    <Router>
      <div>
        <Routes> {/* Trocar para Routes */}
          <Route path="/login" element={<Login />} /> {/* Usar "element" em vez de "component" */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
